import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter, Route, Switch } from "react-router-dom"
import './index.css';
// import Live from './Live';
// import Login from './Login';
// import Cadastro from './Cadastro';
// import PainelChat from './PainelChat';
import App from './App';

ReactDOM.render((
  <BrowserRouter basename="/otoquequetransforma">
     <Switch>

          {/*
            <Route path="/login" exact component={ Login } />
            <Route path="/encerrado" exact component={ Encerrado } />
            <Route path="/salas" exact component={ Salas } />
            <Route path="/:customPath" exact component={ Live } /> 
            <Route path="/painelchat" exact component={ PainelChat } />
            <Route path="/coletiva" exact component={ Login } />
            <Route path="/login" exact component={ Login } />
            <Route path="/live" exact component={ Live } />
          */}
          <Route path="/" exact component={ App } />

      </Switch>
  </BrowserRouter>
), document.getElementById('root'));
